import React, { useState } from "react"; // Importação corrigida
import "../styles/CadastroImovel.css";

const CadastroImovelVenda = () => {
  const [showMessage, setShowMessage] = useState(false);

  const handleCadastrar = (event) => {
    event.preventDefault();
    setShowMessage(true);
    setTimeout(() => setShowMessage(false), 3000);
  };

  return (
    <div className="container">
      <header className="headerCi">
        <h1>Cadastro do Imóvel para Venda</h1>
      </header>
      <div className="form-container">
        <form onSubmit={handleCadastrar}>
          {/* Formulário de cadastro */}
          <div className="form-actions">
            <button type="submit" className="btn-submit">
              Cadastrar Imóvel
            </button>
          </div>
        </form>
        {showMessage && (
          <div className="confirmation-message">Imóvel cadastrado com sucesso!</div>
        )}
      </div>
    </div>
  );
};

export default CadastroImovelVenda;
